import React from 'react';
import styled from 'styled-components';
import Button from '../common/Button';

const MyInfoArticle = styled.article`
  display: flex;
  justify-content: flex-start;
  border: 1px solid red;
`;
const MySummonerImage = styled.img`
  width: 6rem;
  height: 6rem;
  border-radius: 3rem;
  border: 1px solid black;
  margin-left: 0.4rem;
  margin-top: 0.4rem;
  margin-left: 0.4rem;
`;
const Info = styled.div`
  display: flex;
  margin: 0 auto;
  flex-direction: column;
  justify-content: space-around;

  p {
    text-align: center;
  }
`;
const Buttons = styled.div`
  button {
    margin: 0 0.4rem;
  }
`;

const MyInfo = () => {
  return (
    <MyInfoArticle>
      <MySummonerImage
        src={
          'data:image/jpeg;base64,'
        }
      />
      <Info>
        <p>오이오이길쭉이</p>
        <Buttons>
          <Button>내정보</Button>
          <Button>로그아웃</Button>
        </Buttons>
      </Info>
    </MyInfoArticle>
  );
};

export default MyInfo;
